import React, { Component } from "react";
import { withTranslation } from "react-i18next";
import { Button } from "semantic-ui-react";
import i18n from "i18next";
import { history } from "../../helpers";
import { routeConstants } from "../../constants";
 class PrivacyPolicyPageAR extends Component {
  handleBackButton() {
    history.push(`${routeConstants.LANDINGPAGE}`);
  }
  componentDidMount() {
    document.body.dir = i18n.dir();
  }
  render() {
    const language = localStorage.getItem("i18nextLng");
    const { t } = this.props;
    return (
      <div className={`PrivacyPolicy ${language}`}>
               نص سياسات الاستخدام العربي قيد المراجعة (النص باللغه الانجليزيه متاح)
        <Button className={`backButton ${language}`} onClick={this.handleBackButton}>
          {t("landingPage:TermsAndConditionsButton")}
        </Button>
      </div>
    );
  }
}
export default withTranslation("landingPage")(PrivacyPolicyPageAR);
